import '../styles/Button.css';

export default props => {

let classes = `button`
props.operation ? classes = 'operation' : ''
props.double ? classes ='double' : ''
props.triple ? classes ='triple': ''


return(<button className={classes}>
{props.label}
</button>
)
}
